import "./projects.css";

function Projects() {
  return (
    <div>
      <div
        className="subtitle"
        id="projects-title"
        data-aos="fade-right"
        data-aos-duration="1000"
      >
        My Projects<span style={{ color: "#e4448f" }}>.</span>
      </div>
      <hr
        id="projects-line"
        data-aos="fade-right"
        data-aos-duration="1000"
      ></hr>
    </div>
  );
}
export default Projects;
